                "POLICY.TITLE_1": "Returns and Refund Policy",
                "POLICY.TEXT_1": "JIJI allows its users to publish advertisements of their goods and services on an online platform. Sellers and services providers shall \n        be solely responsible for compliance with the applicable consumer and competition protection laws. If you offer goods or services on the Platform \n        (as defined in the Terms of Use), you shall grant to the consumers the rights as described below.",
                "POLICY.TITLE_2": "Rights in relation to services",
                "POLICY.TEXT_2": "When you agree to perform any service for or on behalf of an end user, the end user has a right to: (a) the timely performance and \n        completion of those services, and timely notice of any unavoidable delay in the performance of the services; (b) performance of the services in a \n        manner and quality that reasonable persons are generally entitled to expect; (c) the use, delivery or installation of goods that are free of \n        defects and of a quality that persons are generally entitled to expect, if the goods are required for the performance of the services; and (d) \n        the return of any property or control over any property of the end user in at least as good a condition as it was when the end user made it available \n        to the service provider for the purpose of performing the services, having regard to the circumstances of the supply, and any specific criteria or \n        conditions agreed between the service provider and the end user before or during the performance of the services. Where you fail to perform a service\n        to the standards contemplated above the end user may require you to either (a) remedy any defect in the quality of the services performed or goods \n        supplied; or (b) refund to the end user a reasonable portion of the price paid for the services performed and goods supplied, having regard to the \n        extent of the failure.",
                "POLICY.TITLE_3": "Rights in relation to goods",
                "POLICY.TEXT_3": "Every end user has a right to receive goods that: (a) are reasonably suitable for the purposes for which they are generally intended; \n        (b) are of good quality, in good working order and free of defects; (c) will be useable and durable for a reasonable period of time, having regard \n        to the use to which they would normally be put and to all the surrounding circumstances of their supply; and (d) comply with any applicable standards\n        set by industry sector regulators. In addition to the rights set out above, if an end user has specifically informed you of the particular purpose for\n        which the end user wishes to acquire any goods, or the use to which the end user intends to apply those goods, and you ordinarily offer to supply such\n        goods or acts in a manner consistent with being knowledgeable about the use of those goods, the end user has a light to expect that the goods are\n        reasonably suitable for the specific purpose that the end user has indicated. Within three months after the delivery of any goods to an end user the\n        end user may return the goods to you without penalty and at your risk and expense, if the goods fail to satisfy the requirements and standards\n        contemplated above and you shall either repair or replace the failed, unsafe or defective goods or refund to the end user the price paid by the\n        end user for the goods.",
                "POLICY.TITLE_4": "Right to return goods",
                "POLICY.TEXT_4": "In addition to end users right to return unsafe or defective goods, the end user may return goods to the supplier and receive a full \n        refund of any consideration paid for those goods, if the supplier has delivered: (a) goods intended to satisfy a particular purpose communicated \n        to the supplier and within a reasonable time after delivery to the end user, the goods have been found to be unsuitable for that particular purpose;\n        or (b) goods that the end user did not have an opportunity to examine before delivery, and the end user has rejected delivery of the goods within a \n        reasonable time after delivery to the end user for the reason that the goods do not correspond with description, sample or that they are not of the \n        type and quality reasonably contemplated in the sales agreement",
                "POLICY.TITLE_5": "Right to cancel an advance booking, reservation or order",
                "POLICY.TEXT_5": "An end user shall have the right to cancel any advance booking, reservation or order for any goods or services, subject to a reasonable\n        charge for cancellation of the order or reservation by the supplier or service provider. A charge is unreasonable if it exceeds a fair amount in the\n        circumstances, having regard to: (a) the nature of the goods or services that were reserved, booked or ordered; (b) the length of notice of\n        cancellation provided by the end user; (c) the reasonable potential for the supplier or service provider, acting diligently, to find an alternative \n        end user between the time of receiving the cancellation notice, and the time of the cancelled reservation, booking or order, and (d) the general \n        practice of the relevant industry. A supplier or service provider may not impose any cancellation fee in respect of a booking, reservation or order \n        if the end user is unable to honor the booking, reservation or order because of the death or hospitalization of the person for whom, or for whose \n        benefit the booking, reservation or order was made.",
                "POLICY.TITLE_6": "Liability for defective goods",
